using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct WaitComponentResolver : IResolver<WaitComponent>, IResolver<WaitComponentResolver,WaitComponent>, IData	{		public WaitComponentResolver In(ref WaitComponent waitcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetWaitComponent();			Out(ref local);		}		public void Out(ref WaitComponent waitcomponent)		{		}	}}